const API_URL = "http://localhost:8000";

export const fetchFlights = async (from, to) => {
  const res = await fetch(
    `${API_URL}/flights?from_city=${from}&to_city=${to}`
  );
  return res.json();
};

export const fetchSeats = async (flightId) => {
  const res = await fetch(`${API_URL}/flights/${flightId}/seats`);
  return res.json();
};
